import React from 'react';
import { IonPage, IonBackButton, IonButtons, IonToolbar, IonHeader, IonContent, IonTitle, IonLabel, IonIcon, IonItem } from '@ionic/react';


const Help:React.FC = () =>{
    return(
        <IonPage>
            <IonHeader>
                <IonToolbar>
                    <IonItem>
                        <IonButtons onClick={()=>{
                        }} slot="start">
                            <IonBackButton defaultHref=""/>
                        </IonButtons>
                        <IonTitle>Help</IonTitle>
                    </IonItem>
                </IonToolbar>
            </IonHeader>
            <IonContent>
                <div style={{marginTop:"40%",marginBottom:"40%",textAlign:"center"}}>
                    <IonLabel>Comming soon</IonLabel>
                </div>

            </IonContent>

        </IonPage>
    )
}

export default Help;
